import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function NewEntry(forNote){
  return (
    <Note 
      key = {forNote.key}
      title = {forNote.title} 
      content = {forNote.content}
    />
  )
}


function App() {
  return (
    <div>
      <Header />
     { notes.map(NewEntry)}
      <Footer />
    </div>
  );
}

export default App;
